    <SixContainer  clickOne={NextObject}/>]



  return (
   <Layout>
     <AnimateSharedLayout>
     {objects[objectDisplay]}
        {/* <OneContainer clickOne={NextObject} visible={objectDisplay===1 ? true : false}/>
